import React from 'react'
import Container from "react-bootstrap/Container";
import styled from "styled-components";
import Skewleft from './Skewleft';
import Typography from '@mui/material/Typography';
import award from '../assets/images/award.jpg'

const Areacounting = () => {
    const Countingwrapper = styled.section`
        display:flex;
        position:relative;
        .counting_section{
            margin-top:270px;
            height:100vh;
            .parent{
                border: solid;
                div{
                }
                .label{
                    margin-bottom:15px;
                    h3{
                    color:${({theme})=>theme.colors.headeractive};
                    font-family:inherit;
                    margin:0!important;
                    }
                    span{
                        color:${({theme})=>theme.colors.text7};
                        position: relative;
                        font-size:14px;

                    }
                }
                .list_details{
                    display:flex;
                    flex-wrap:wrap;
                    flex-direction:row;
                    .list{
                        flex:1 1 20%
                        .image_container{
                            img{

                            }
                            span{

                            }
                        }
                        span{

                        }
                    }
                }
            }
        }
    
    `;

  return (
    <Countingwrapper>
        <Skewleft/>
        <Container className="counting_section common_margin">
            <div className='parent'>
                <div className='label'>
                    <Typography variant="h3" className='mt-3'>Let's check</Typography>
                    <span>No. of student by Area</span>
                </div>
                <div className='list_details'>
                    <section className='list'>
                        <div className='image_container'>
                            <img src={award} alt="demko"/>
                            <span>98</span>
                        </div>
                        <span>khattalawada</span>                        
                    </section>
                </div>
            </div>
        </Container>
    </Countingwrapper>
  )
}

export default Areacounting
